import React from 'react';
import { NavLink } from 'react-router-dom';

const TopMenu = () => {
    return (
        <nav>
            <ul>
                <li><NavLink exact to="/" isActive={(match, location) => location.pathname === '/' && location.pathname !== '/pick-dish' && location.pathname !== '/contact'}>Home</NavLink></li>
                <li><NavLink to="/pick-dish">Pick Dish</NavLink></li>
                <li><NavLink to="/contact">Contact</NavLink></li>
            </ul>
        </nav>
    );
}

export default TopMenu;
